import React from 'react';
import classes from './FooterList.module.css';

const Footer = (props) => (
  <>
    <li className={classes.List}>
      <a className={classes.Anchor} href={props.redirect}>
        <span
          style={{
            backgroundImage: `url("${props.icon}")`,
          }}
        ></span>
        {props.footerContent}
      </a>
    </li>
  </>
);

export default Footer;
